news-feed\items\httpsfeedqgisorg\entries\items\97\content="<p>QGIS has a new map gallery! We are looking for submissions of beautiful maps made using QGIS. The maps will be displayed on the main web site at https://qgis.org if approved. Our goal is to show off the power and versatility of QGIS to the world. If you have a great map to share, <strong>double click this article</strong> to visit the gallery and start sharing your submissions!</p>"
