news-feed\items\httpsfeedqgisorg\entries\items\103\content="<p data-start=\"63\" data-end=\"137\">We&rsquo;re migrating to <strong data-start=\"82\" data-end=\"89\">Qt6</strong> and launching <strong data-start=\"104\" data-end=\"116\">QGIS 4.0</strong> in <strong data-start=\"120\" data-end=\"136\">October 2025</strong>!</p>\r\n<p data-start=\"139\" data-end=\"324\">Expect modern libraries with performance and security improvements, a smooth transition for plugin devs, and a few pleasant surprises. <strong>Double-click</strong> this article for details!</p>"
