news-feed\items\httpsfeedqgisorg\entries\items\109\content="<p>Oslandia, partners and QGIS users, have launched the <strong>Security project for QGIS</strong>. Key topics for security improvements have been identified, and work packages with budget estimations created:</p>\r\n<p>- Raise the cybersecurity level for the QGIS project</p>\r\n<p>- Fulfill cybersecurity requirements from regulations and end-users ( CRA, NIS2, ...)</p>\r\n<p>- Make QGIS an example of a security-aware Open Source project</p>\r\n<p>Register for a webinar on June 17 to learn more ...</p>"
